using SQLite4Unity3d;
using UnityEngine;
using System.Collections;
using System.IO;
using UnityEngine.Networking;
using System.Collections.Generic;
using Scripts.RandomCardText;
using Scripts.CardImage;
using System.Linq;

namespace Scripts.Database
{
	public class Database
	{
		private readonly SQLiteConnection _connection;

		private Database(string DatabaseName)
		{
			var filepath = string.Format("{0}/{1}", Application.persistentDataPath, DatabaseName);

			if (!File.Exists(filepath))
			{
				var loadDb = new WWW("jar:file://" + Application.dataPath + "!/assets/" + DatabaseName);
				while (!loadDb.isDone)
				{
					Debug.Log("Filling database.");
				}

				File.WriteAllBytes(filepath, loadDb.bytes);
			}

			var dbPath = filepath;

			_connection = new SQLiteConnection(dbPath, SQLiteOpenFlags.ReadWrite | SQLiteOpenFlags.Create);
		}

		public static Database InitializeDatabase(string databaseName)
        {
			return new Database(databaseName);
        }

		public void CreateTables()
        {
			this.InsertCardData();
			this.InsertImageData();
		}

		private void InsertCardData()
		{
			this._connection.DropTable<Text>();
			this._connection.CreateTable<Text>();

			_connection.InsertAll(new Text[] {
				new Text(1, "Por cada número {Num} que aparezca en el dado se eliminará un elemento {Element} de la mochila."),
				new Text(2, "Por cada número {Num} que aparezca en el dado se añadirá un elemento {Element} de la mochila."),
				new Text(3, "Si aparece un número {Num} en el dado se añadirá un elemento {Element} a la mochila."),
				new Text(4, "Si aparece un número {Num} en el dado se eliminará un elemento {Element} a la mochila."),
				new Text(5, "Durante las próximas 2 tiradas si sacas un {Num} volverás a la casilla de inicio."),
				new Text(6, "Durante las próximas 3 tiradas si obtienes un elemento {Element} se convertirá en elemento {ChangeElement}.")
			});
		}

		private void InsertImageData()
        {
			this._connection.DropTable<Image>();
			this._connection.CreateTable<Image>();

			this._connection.InsertAll(new Image[] {
				new(1, "data:image/png;base64,"),
				new(2, "data:image/png;base64,"),
				new(3, "data:image/png;base64,"),
				new(4, "data:image/png;base64,"),
				new(5, "data:image/png;base64,"),
				new(6, "data:image/png;base64,")
			});
		}

		private static string ReplaceVariablesInCardText(string cardText, int num, string element, string changeElement)
        {
            string result = cardText.Replace("{Num}", num.ToString());
            result = result.Replace("{Element}", element);
            result = result.Replace("{ChangeElement}", changeElement);
            return result;
        }

        public List<string> GetTextTableData(int num, string element, string changeElement)
		{
			List<string> result = new() { };

			IEnumerable<Text> databaseData = this._connection.Table<Text>();
			foreach (Text elem in databaseData)
			{
				string text = ReplaceVariablesInCardText(elem.CardText, num, element, changeElement);
				result.Add(text);
			}

			return result;			
		}

		public List<string> GetImagesTableData()
        {
			List<string> result = new() { };

			IEnumerable<Image> databaseData = this._connection.Table<Image>();
			foreach (string elem in databaseData.Select(image => image.ImageBase64))
			{
				result.Add(elem);
			}

			return result;
		}
	}
}
